import React,{Component} from "react";
import ReactDOM from "react-dom";
import {Carousel} from "antd";
import "antd/dist/antd.css";

class Slid extends Component {
    
    render() { 
        return ( 
            <Carousel autoplay>
            <div>
                    <img  src={require(`../static/horaire.jpg`)}  alt="Smiley face" height="400" width="400"/>
            </div>
            <div>
                <h3>2</h3>
            </div>
            <div>
                <h3>3</h3>
            </div>
            <div>
                <h3>4</h3>
            </div>
          </Carousel>
         );
    }
}
 export default Slid;
